import React from "react";

function ToDoList(props){
    return(
    <div className="to-do-list">
        <form>
            <input type="text" id="lname" name="lname">Title</input>
            <br></br>
            <ul>
            <li>Item 1</li>
            <li> Item 2</li>
        </ul>

        </form>
    </div>);

}

export default ToDoList;
